import React, { Component } from 'react';

class Header extends Component{
    render(){
        return (
            <header>
                <nav>
                    <li><a>projects</a></li>
                    <li><a>art</a></li>
                    <li><a>about</a></li>
                    <li><a>contact</a></li>
                </nav>
            </header>
        )
    }
}

export default Header;
